import axios from 'axios'

export default function Band() {
  const getAllTourDates = () => {
    axios.get('http://localhost:3000/tourDates')
    .then(res => {
      console.log(res)
    }).catch(err => {
      console.log(err)
    })
  }
  getAllTourDates()
}
